import React, { Component } from 'react';
import axios from 'axios'
import Map from './Map'
import FormContact from './FormContact/FormContact'
import { Card,Paper, Grid } from '@material-ui/core';
import '../pages/css/Home.css'
import './ax.css'

export default class Axios extends Component {
    state = {
        prop: [],
        id: '',
        tittle: '',
        price: '',
        direccion: '',
        smallContent: '',
        coordenadasP: []
    }

    componentDidMount() {
            axios.get("http://localhost:3001/propiedades/" + this.props.value)
            .then(res => {
                const prop = res.data
                this.setState(
                    {
                        id: prop.id,
                        tittle: prop.tittle,
                        price: prop.price,
                        direccion: prop.direccion,
                        coordenadasP: prop.coordenadasP
                    }
                )
            })    
    }


    render() {
        const { id } = this.state
        const { tittle } = this.state
        const { coordenadasP } = this.state
        const zoomP = 13
        const heightP = 300
        const prefijo = "PROPIEDAD"
        const text = "Consultar por la Propiedad"

        const lat = coordenadasP[0]
        const lng = coordenadasP[1]
        const position = [lat,lng]

        console.log(coordenadasP)
        console.log(position)

        console.log(coordenadasP[0]);
        console.log(coordenadasP[1]);

        console.log(lat);
        console.log(lng);

        return (
            <>
                <Grid item xs={12}>
                    <Paper id="m" className='paper_prim'>
                        <h1>{tittle}</h1>
                        <h1>{direccion}</h1>
                        <h1>{price}</h1>
                    </Paper>
                </Grid>

                <Grid container>
                    <Card className='main1'>
                        <h1 className='paper_prim'>Propiedades por Regiones</h1>
                        <FormContact
                            asunto={tittle}
                            pref={prefijo}
                            encabezado={text}
                        />

                    </Card>
                    <Card className='main2'>
                        <h1 className='paper_prim'>Propiedades</h1>

                    </Card>
                </Grid> 




                <h2>{this.props.tittle}</h2>
                <h3>{this.props.price}</h3>
                <p>{coordenadasP}</p>

                {/* <Map
                    lat={lat}
                    lng={lng}
                    zoom={zoomP}
                    popup={tittle}
                />*/}


            </>
        )
    }
}
